for r in rs:
    if len(r) == 1:
        vs = next(iter(r.values()))
        for v in vs:
            e.append(process(v))
    else:
        v = r
        e.append(process(v))

logger.info(len(e))
keys = set()
for d in e:
    keys.update(d.keys())

with open('nora.csv', 'w', newline='', encoding = 'utf-8') as file:
    writer = csv.DictWriter(file, fieldnames=list(keys))
    writer.writeheader()
    writer.writerows(e)
